import React from "react";
import { BrowserRouter as router, Route } from 'react-router-dom';
import { Navbar, Button } from "reactstrap";

const App = () => {
  return (
    <Route>
      <Navbar color='info'>
        <h1 style={{ color: 'white' }}>WeEat</h1>
        <Button color='info'>
          Home
      </Button>
      </Navbar>
    </Route>


  );
};
export default App;
